Nữ diễn viên Ha Jiwon gắn thẻ V với #덕분에챌린지 (Thử thách vì bạn) trên Insta. Thử thách này dành cho các nhân viên y tế đã làm việc chăm chỉ trong bối cảnh COVID-19. Ha Jiwon là của Taehyung, cô là nữ diễn viên hàng đầu ở Hàn Quốc❤️🥺
Cre: choi_bts2
@BTS_twt pic.twitter.com/xhtViAftFC

Nữ diễn viên HQ, Ha Jiwon đã tag V với #덕분에챌린지 ('Vì bạn' Thử thách 👍) trên Insta của cô.  Thử thách dành cho các nhân viên y tế đã làm việc chăm chỉ cho người dân mùa COVID-19. Cô là một trong những người bạn nổi tiếng của Taehyung. 
@BTS_twt 
©choi_bts2 pic.twitter.com/dG51O0T0US

